import React from "react";
import SidebarOption from "../sidebaroption/SidebarOption";

export default function Sidebar() {
    return (
        <div className="sidebar">
            SidebarOption(text="Home")
            SidebarOption(text="Messages")
            SidebarOption(text="Contacts")
            SidebarOption(text="Chat")
            SidebarOption(text="Bots")
            SidebarOption(text="IDK")
            SidebarOption(text="Analytics")
            SidebarOption(text="Help")
            SidebarOption(text="Addons")
        </div>

    )
}
